import React, { useMemo } from "react"
import { ReactSVG } from "react-svg"
import { Image } from "rebass"
import { baseUrl } from "../../utils/helper"

export default props => {
	const { width, svgUrl, shadowUrl, type, key } = props
	return (
		<div
			style={{
				position: "relative",
				width: width
			}}
		>
			<Image
				src={baseUrl + shadowUrl}
				sx={{
					width: width,
					position: "absolute"
				}}
			/>
			<ReactSVG
				style={{
					width: width,
					minWidth: "14px"
				}}
				renumerateIRIElements={false}
				loading={() => {
					console.log("loading")
					return "loading"
				}}
				beforeInjection={svg => {
					svg.setAttribute("id", key)
					svg.setAttribute("style", `width: ${width}; height: 100%`)
				}}
				evalScripts="always"
				src={baseUrl + svgUrl}
			></ReactSVG>
		</div>
	)
}
